#' \item \strong{ID} \emph{numeric}   Range value: 2, ..., 308
#' \item \strong{RID} \emph{numeric} Participant roster ID Range value: 55, ..., 5277
#' \item \strong{SITEID} \emph{numeric} Site ID Range value: 1, ..., 60
