#' \item \strong{USERDATE2} \emph{ } Date record last updated Date: YYY-MM-DD
#' \item \strong{RECNO} \emph{numeric}   Range value: 1, ..., 2
#' \item \strong{TAUELG} \emph{numeric} Please confirm if participant meets eligibility criteria: 1=Participant is eligible ; 0=Participant should be excluded
#' \item \strong{EXCLUSION} \emph{numeric} If participant should be excluded, select reason: 1=Exclusion Criteria
#' \item \strong{NVROT} \emph{numeric}   1=Other (specify)
#' \item \strong{NVRSPECIFY} \emph{character} If Other, specify: , with options: Participant did not consent to scan, Exluded from Past EKG results
#' \item \strong{EXC1} \emph{logical} If Exclusion Criteria, which criteria does the participant meet: 1=[1] Has any condition that, in the investigator's opinion, could increase risk to the participant, limit the participant's ability to tolerate the experimental procedures, or interfere with collection/analysis of the data (for example, participants with severe chronic back pain might not be able to lie still during the scanning procedures).
#' \item \strong{EXC2} \emph{logical}   1=[2] Has abnormal findings on physical examination, or laboratory screening tests that suggest the patient might have a condition that could, in the opinion of the investigator, affect his or her response to the radiopharmaceutical and related testing procedures.
#' \item \strong{EXC3} \emph{logical}   1=[3] Is deemed likely to be unable to perform all of the addendum imaging procedures for any reason.
#' \item \strong{EXC4} \emph{logical}   1=[4] Female that is pregnant, lactating, or of childbearing potential
