#' \emph{Decoded Value: }\strong{Yes}
#' \item \strong{AEPENUM} \emph{numeric} Initial Health Assessment Condition Number: Range value: 0, ..., 59
#' \item \strong{AECOMPOUND} \emph{character} Is this event part of a compound event? 0=No ; 1=Yes
