#' \emph{Decoded Value: }\strong{Yes}
#' \item \strong{AERELNAV} \emph{character} Related to NAV-4694 tracer 1=Definitely ; 2=Probably ; 3=Possibly ; 4=Unlikely ; 5=Not related
#' \emph{Decoded Value: }\strong{Yes}
#' \item \strong{AERELMK} \emph{character} Related to MK-6240 tracer 1=Definitely ; 2=Probably ; 3=Possibly ; 4=Unlikely ; 5=Not related
#' \emph{Decoded Value: }\strong{Yes}
#' \item \strong{AERELPI} \emph{character} Related to PI-2620 tracer 1=Definitely ; 2=Probably ; 3=Possibly ; 4=Unlikely ; 5=Not related
#' \emph{Decoded Value: }\strong{Yes}
#' \item \strong{AEHLUMB} \emph{character} Related to lumbar puncture 1=Definitely ; 2=Probably ; 3=Possibly ; 4=Unlikely ; 5=Not related
