ble c. Gingko biloba is permissible, but discouraged d. Washout from psychoactive medication (e.g., excluded antidepressants, neuroleptics, chronic anxiolytics or sedative hypnotics, etc.) for at least 4 weeks prior to screening e. Cholinesterase inhibitors and memantine are allowable if stable for 12 weeks prior to screen f. Aducanumab and any other approved treatments for the neurobiology of AD if stable for 24 weeks prior to screen ; newpt7=1. Geriatric Depression Scale score less than 10. ; newpt8=2. Age between 55-90 years (inclusive). ; newpt9=3. Study partner who has frequent contact with the participant (i.e., minimum average of 2 hours per week) and may be able to accompany the participant to clinic visits or provide information remotely (e.g. over the phone).
